import { Component, OnInit } from '@angular/core';
import { LoginService } from '../login.service';
import { GeneralApiService } from '../general-api.service';
import { first } from 'rxjs';

@Component({
  selector: 'app-hostogram',
  templateUrl: './hostogram.component.html',
  styleUrls: ['./hostogram.component.scss'],
})
export class HostogramComponent implements OnInit {
  token!: string;
  bloodPressure$!: number[];

  constructor(
    private loginService: LoginService,
    private api: GeneralApiService
  ) {}

  ngOnInit(): void {
    this.token = this.loginService.LoginToken;

    this.api.getUserBloodPressure(this.token)
    .pipe(first())
  }
}
